    "crescent-lake-national-wildlife-refuge-annual-narrative-report-calendar-year-1979",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Crescent
    Lake National Wildlife Refuge outlines Refuge accomplishments during the 1979 calendar
    year. The report begins by describing the climate and habitat conditions in the
    Refuge, as well as the land acquisition program and system status. The construction
    and maintenance section describes physical developments, maintenance, and wildfires.
    The habitat management section discusses grasslands, wetlands, and wilderness and
    special areas. Wildlife- including endangered and threatened species, migratory
    birds, big game animals, and raptors- are discussed. The public relations sections
    describes recreational uses and enforcement. Field investigations, items of interest,
    N-R forms, and photographs are attached.",nt"license_title": "License Not
